import totalToRender from "./totalToRender"
import ProfileListItem from "./profileListItem"

export default function ProfileListContent({profileDataToRender, totalToRenderNumber,
                                            focused, setFocused}) {
                                              
  return totalToRender(profileDataToRender, totalToRenderNumber).map((item, i) => (
    <ProfileListItem 
      key={`ListItem${i}`} 
      data={item}
      focused={focused} 
      setFocused={setFocused}/>
  ))
}
